import classes from "./Contact.module.css";
import Container from "react-bootstrap/esm/Container";
import Col from "react-bootstrap/esm/Col";
import Row from "react-bootstrap/esm/Row";



const Contact = () => {
    return ( 
        <section id="contact" className={classes.contact}>
            <Container>
                <h4 className={classes.header}>Contact</h4>
                <Row className="justify-content-center">
                    <Col sm={8}>
                        <form action="mailto:spenceraj@vt.edu" enctype="text/plain">
                            <label htmlFor="">Subject: </label>
                            <input type="text" required id=""/>
                            <label htmlFor="email">Email: </label>
                            <input type="text" placeholder="Your Email" required id="email"/>
                            <label htmlFor="message">Message:</label>
                            <textarea name="body" id="message" cols="30" rows="10"></textarea>
                            <input type="submit" value="send" />
                        </form>
                    </Col>
                </Row>


            </Container>
        </section>
     );
}

export default Contact;
